import { Account, InputBoxStateProps, UploadedFileProps } from "@/app/types";
import { AES, enc } from "crypto-js";

export function decrypt(string: string, key: string) {
  const decrypted = AES.decrypt(string, key).toString(enc.Utf8);
  return decrypted as string;
}

export function encrypt(string: string, key: string) {
  const decrypted = AES.encrypt(string, key).toString();
  return decrypted as string;
}

export function classNames(...classes: any[]) {
  return classes.filter(Boolean).join(" ");
}
export function encryptFields(
  fields: InputBoxStateProps[],
  masterPassword: string
) {
  return fields.map((field) => ({
    ...field,
    name: encrypt(field.name, masterPassword).toString(),
    value: encrypt(field.value, masterPassword).toString(),
  }));
}

export function encryptFiles(
  files: UploadedFileProps[],
  masterPassword: string
) {
  return files.map((file) => ({
    ...file,
    data: encrypt(file.data, masterPassword).toString(),
  }));
}

export function defaultProfilePicture() {
  return "data:image/png;base64,";
}
